import React from 'react';
import { motion } from 'framer-motion';
import { BrainCircuit, Users, Zap, Rocket } from 'lucide-react'; // Import icons

const PassionSection = () => {
  return (
    <section className="bg-gradient-to-br from-purple-900 to-blue-900 text-white py-16 md:py-24">
      <div className="container mx-auto px-4">
        <div className="text-center mb-12">
          <h2 className="text-3xl md:text-4xl font-bold mb-4 bg-clip-text text-transparent bg-gradient-to-r from-purple-400 to-pink-500">
            The fire that fuels our passion.
          </h2>
          <p className="text-gray-300 text-lg">At Praman Tech, we believe in the power of:</p>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-8">
          {/* Creativity Card */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
            viewport={{ once: true }}
            className="bg-white/5 backdrop-blur-md rounded-xl p-6 border border-white/10 shadow-lg hover:shadow-xl hover:scale-[1.02] transition-all duration-300"
          >
            <div className="flex items-center gap-4 mb-4">
              <BrainCircuit className="w-8 h-8 text-purple-400" />
              <h3 className="text-xl font-semibold">Creativity.</h3>
            </div>
            <p className="text-gray-300">
              We dare to dream big and push boundaries, never settling for the ordinary.
            </p>
          </motion.div>

          {/* Collaboration Card */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.2 }}
            viewport={{ once: true }}
            className="bg-white/5 backdrop-blur-md rounded-xl p-6 border border-white/10 shadow-lg hover:shadow-xl hover:scale-[1.02] transition-all duration-300"
          >
            <div className="flex items-center gap-4 mb-4">
              <Users className="w-8 h-8 text-blue-400" />
              <h3 className="text-xl font-semibold">Collaboration.</h3>
            </div>
            <p className="text-gray-300">
              We thrive on diverse perspectives and believe in the magic of working together.
            </p>
          </motion.div>

          {/* Impact Card */}
            <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.4 }}
            viewport={{ once: true }}
            className="bg-white/5 backdrop-blur-md rounded-xl p-6 border border-white/10 shadow-lg hover:shadow-xl hover:scale-[1.02] transition-all duration-300"
          >
            <div className="flex items-center gap-4 mb-4">
              <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="lucide lucide-zap-circle w-8 h-8 text-green-400"><path d="M12 22c5.523 0 10-4.477 10-10S17.523 2 12 2 2 6.477 2 12s4.477 10 10 10Z"/><path d="M12 8v8"/><path d="m9 15 3-5 3 5"/></svg>
              <h3 className="text-xl font-semibold">Impact.</h3>
            </div>
            <p className="text-gray-300">
              We&apos;re driven by a desire to make a difference, to create brands that move mountains.
            </p>
          </motion.div>

          {/* Innovation Card */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.6 }}
            viewport={{ once: true }}
            className="bg-white/5 backdrop-blur-md rounded-xl p-6 border border-white/10 shadow-lg hover:shadow-xl hover:scale-[1.02] transition-all duration-300"
          >
            <div className="flex items-center gap-4 mb-4">
              <Rocket className="w-8 h-8 text-pink-400" />
              <h3 className="text-xl font-semibold">Innovation.</h3>
            </div>
            <p className="text-gray-300">
              We stay ahead of the curve, embracing new technologies & trends to keep your brand on top.
            </p>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default PassionSection;
